  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115023 includes chemical,
  discrete sample, physical and profile data collected from KAIYO-MARU in the East
  China Sea (Tung Hai) and Philippine Sea from 1996-06-20 to 1996-07-15 and retrieved
  during cruise WOCE_P08N. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and bottle. These data were
  collected by T. Amaoka of Hokkaido University as part of the WOCE_P08N data set.nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
